/**
 * Helpful utilities for projects
 *
 * @type {Object} commonAU object
 */
var commonAU = {
  debugger: function( errorMessage ) {
    errorMessage = '';
    return 'cAU: ' + '\n' + errorMessage;
    debugger;
  },
  debug: false
}

